import {store} from "./store";
import {BrowserRouter, Routes} from "react-router-dom";


function App() {
    return (
        <Provider store={store}>
            <Layout>
                <BrowserRouter>
                    <Routes>

                    </Routes>
                </BrowserRouter>
                <StorePage />
            </Layout>
        </Provider>
    );
}

export default App;
